create table uaa_permission
(
    ID                varchar(36)          not null comment '权限(接口)id(uuid)'
        primary key,
    DOMAIN_ID         bigint               null comment '域ID',
    URL               varchar(256)         null comment 'url地址',
    NAME              varchar(64)          null comment 'url描述',
    STATUS            tinyint(1)           null comment '状态',
    UPDATE_TIME       datetime             null comment '更新时间',
    CREATE_TIME       datetime             null comment '创建时间',
    PLATFORM_ID       bigint     default 1 null comment '添加默认值',
    DIMENSION         bigint               null comment '数据权限维度ID',
    IS_BIND           tinyint(1)           null comment '是否绑定菜单，1-已绑定（至少绑定一个）0-未绑定',
    AUDIT_LOG         tinyint(1) default 0 null comment '是否进行日志记录审核（1-审计日志，0-不审计日志）',
    TYPE              tinyint(1) default 0 null comment '权限类型（1-数据权限，2-业务权限，3-数据和业务权限）',
    TRACE_LOG         tinyint(1) default 0 null comment '1-开启追踪日志 0-不开启',
    OPERATION_CONTENT varchar(255)         null comment '操作内容模板',
    RESPONSE_CONTENT  varchar(255)         null comment '响应内容模板'
)
    row_format = DYNAMIC;

